import React, { useEffect, useState } from "react";
import "../../App.css";
import Fade from 'react-reveal/Fade';
import Typist from "react-typist";
import "../Styles/Experience.css";

class Experience extends React.Component {

  state = {
    text: 'something'
  }

  onClickButton1 = () => {
    this.setState({
      text: 'clicked 1'
    });
  }

  onClickButton2 = () => {
    this.setState({
      text: 'clicked 2'
    });
  }
  render(){
  return (
    
      <div className="exp-container" > 
          <Typist className="exp-header">
          
          /experience
          </Typist>
        <div style={{ display: "flex" }}>
        <button style={{ width: "300px", height: "100px",marginLeft: "auto", marginRight: "auto"}}  onClick={() => this.onClickButton1()}>
          Button 1
        </button>
        <button style={{ width: "300px", height: "100px",marginLeft: "auto", marginRight: "auto"}}onClick={() => this.onClickButton2()}>
          Button 2
        </button>
        </div>
        <h1>{this.state.text}</h1>    
      </div>
    
  );}
}
export default Experience;
